.checkbox {
    display: flex;
    align-items: center;
    &__input {
        position: absolute;
        width: 0;
        height: 0;
        margin: 0;
        opacity: 0;
        &:checked {
            & + .checkbox__element:after {
                transform: translate(-50%,-50%) scale(1);
            }
        }
    }
