        transition: border-color .3s;
        overflow: hidden;
        cursor: pointer;
        &:hover {
            border-color: $active;
        }
        &:after {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%,-50%) scale(0);
            width: 10px;
            height: 8px;
            background: url("/images/icon-check.svg") 50% 50% no-repeat;
            transition: transform .3s;
        }
    }
    &__text {
        line-height: 1.2;
    }
}
