.form {
    &__select {
        position: relative;
        & + &, & + .form__label {
            margin-top: 18px;
        }
        &.--active {
            & .form__select-head:after {
                transform: translateY(-50%) rotate3d(0,0,1,-45deg);
            }
            & .form__select-list {
                opacity: 1;
                transform: none;
                pointer-events: unset;
            }
        }
        &.--selected {
            & .form__select-head {
                color: $black;
                border-color: $border;
                background-color: white;
            }
        }
        &-input {
            position: relative;
            display: block;
            width: 100%;
            margin-bottom: 20px;
        }
        &-head {
            display: block;
            position: relative;
            width: 100%;
            max-width: 100%;
            padding: 23px 24px 18px;            
            font-size: 16px;
            line-height: 18px;
            color: $text_grayL;
            border-radius: 6px;
            border: 1px solid $border;
            background-color: $bg_gray;
            transition: border-color $transition,background-color $transition;
            cursor: text;
            &::before {
                // Arrowcontent: '';
                display: block;
                width: 7px;
                height: 7px;
                position: absolute;
                top: 50%;
                right: 0;
                margin-right: 20px;
                border-top: 1px solid $border_arrow;
                border-right: 1px solid $border_arrow;
                transform: translateY(-50%) rotate3d(0,0,1,135deg);
                transition: transform $transition;
                will-change: transform;
            }
            &::after {
                content: '';
                display: block;
                width: 10px;
                height: 10px;
                position: absolute;
                top: 50%;
                right: 0;
                z-index: 999;
                margin-right: 20px;
                border-top: 1px solid #b2bdcc;
                border-right: 1px solid #b2bdcc;

                -webkit-transform: translateY(-50%) rotate3d(0, 0, 1, 135deg);
                transform: translateY(-50%) rotate3d(0, 0, 1, 135deg);
                -webkit-transition: -webkit-transform 0.3s ease;
                transition: -webkit-transform 0.3s ease;
                transition: transform 0.3s ease;
                transition: transform 0.3s ease, -webkit-transform 0.3s ease;
                will-change: transform;
            }
        }
        &-list {
            position: absolute;
            width: 100%;
            max-width: 100%;
            font-size: 16px;
            line-height: 18px;
            color: $text_black;
            border: 1px solid $border;
            border-radius: 6px;
            background-color: #fff;
            opacity: 0;
            transform: translate3d(0,20px,0);
            transition: transform $transition,opacity $transition;
            box-shadow: $shadow;
            will-change: opacity,transform;
            pointer-events: none;
            cursor: pointer;
            z-index: 10;
        }
        &-item {
            padding: 19px 24px 18px;
            font-size: 16px;
            border-top: 1px solid $bg_gray;
            transition: background-color $transition;
            &:hover {
                background-color: $bg_gray;
            }
        }
    }
}

sources.components/input/input.scss:
.input {
    position: relative;
    display: block;
    padding: 19px 24px 18px;
    border-radius: 7px;
    border: 1px solid $border;
    background-color: $white;
    transition: border-color .3s;
    cursor: text;
    &:hover {
        border-color: $active;
    }
    &.--textarea {
        height: 100%;
        min-height: 155px;
        & .input__element {
            height: 100%;
            font-family: $roboto;
            font-size: 16px;
        }
    }
    &__file {
        position: relative;
        display: block;
        width: 100%;
        cursor: pointer;
        display: flex;
        align-items: center;
        @media(min-width: 1600px) {
            margin-left: 20px;
        }
        & input {
            position: absolute;
            width: 0;
            height: 0;
            opacity: 0;
        }
        &-el {
            display: inline-block;
            vertical-align: middle;
            & + & {
                margin-left: 15px;
            }
        }
        &-icon {
            width: 20px;
            height: 20px;
            background: url('./images/icon-clip.svg') 50% 50% no-repeat;
        }
        &-text {
            line-height: 1.2;
        }
        &-count {
            display: block;
            margin: 10px 0 0 35px;
            width: 100%;
            color: $grey;
            font-size: 13px;
            transition: color .3s;
            &.--error {
                color: $error;
            }
        }
    }
    &.--hasError {
        border-color: $error !important;
        & .input__error-msg {
            opacity: 1;
        }
        & .input__placeholder {
            opacity: 0;
        }
    }
    &.--focused, &.--hasValue {
        border-color: $active;
        & .input__element {
            opacity: 1;
        }
        & .input__error-msg, & .input__placeholder {
            font-size: 12px;
            transform: translateY(-17px);
        }
    }
    &__element {
        width: 100%;
        font-size: 18px;
        resize: none;
        opacity: 0;
        transition: opacity .3s;
        &:focus {
            opacity: 1;
        }
    }
    &__placeholder, &__error-msg {
        position: absolute;
        top: 19px;
        left: 24px;
        will-change: transform;
        transition: font-size .3s,transform .3s,opacity .3s;
    }
    &__placeholder {
        color: $formPlaceholder;
    }
    &__error-msg {
        opacity: 0;
        color: $error;
    }
}
@media (max-width:1200px) {
    .input {
        &.--textarea {
            height: 120px;
        }
    }
}
@media (max-width:767px) {
    .input {
        padding-top: 9px;
        padding-bottom: 9px;
        &__error-msg, &__placeholder {
            top: 12px;
            font-size: 12px;
        }
        &__file {
            &-text {
                font-size: 14px;
            }
            &-count {
                bottom: -1px;
            }
        }
        &.--focused, &.--hasValue {
            & .input__error-msg, & .input__placeholder {
                opacity: 0;
                transform: none;
            }
        }
    }
}
@media (max-width:450px) {
    .input {
        &.--textarea {
            height: 100px;
        }
    }
}

